<!--              </el-form-item>-->
              <el-form-item label="省市区"  prop="chinaArea" :rules="$rules.require">
                <el-cascader expand-trigger="hover" :options="dialogFormArea" v-model="dialogForm.chinaArea">
                </el-cascader>
              </el-form-item>
              <el-form-item label="详细地址"  prop="address" :rules="$rules.require">
                <el-input style="width: 193px!important;" v-model="dialogForm.address" maxlength="30"></el-input>
              </el-form-item>
              <el-form-item  label="建筑时间"  prop="createdTime" :rules="$rules.require">
                <el-date-picker style="width: 193px!important;" value-format="yyyy-MM-dd" v-model="dialogForm.createdTime" type="date" placeholder="选择日期">
                </el-date-picker>
              </el-form-item>
              <el-form-item  label="房间朝向"  prop="orientation" :rules="$rules.require">
                <el-select style="width: 193px!important;" v-model="dialogForm.orientation" placeholder="请选择">
                  <el-option v-for="item in ['朝东','朝南','朝西','朝北','南北']" :key="item" :label="item" :value="item">
                  </el-option>
                </el-select>
