              <el-form-item  label="租赁方式"  prop="lease" :rules="$rules.require">
                <el-select style="width: 193px!important;" v-model="dialogForm.lease" placeholder="请选择">
                  <el-option v-for="item in ['整租','合租']":key="item":label="item":value="item">
                  </el-option>
                </el-select>
              </el-form-item>
            </el-col>
            <el-col :span="12">
              <el-form-item  label="所在楼层"  prop="height" :rules="$rules.require">
                <el-input-number v-model="dialogForm.height" :min="1" :max="30" label=""></el-input-number>
              </el-form-item>
              <el-form-item  label="总楼层"  prop="maxHeight" :rules="$rules.require">
                <el-input-number v-model="dialogForm.maxHeight" :min="1" :max="30" label=""></el-input-number>
              </el-form-item>
              <el-form-item  label="卧室数量"  prop="bedRoom" :rules="$rules.require">
                <el-input-number v-model="dialogForm.bedRoom" :min="1" :max="4" label=""></el-input-number>
              </el-form-item>
              <el-form-item  label="面积"  prop="area" :rules="$rules.require">
                <el-input-number v-model="dialogForm.area" :min="1" :max="200" label=""></el-input-number>
              </el-form-item>
              <el-form-item  label="定价"  prop="price" :rules="$rules.require">
                <el-input-number v-model="dialogForm.price" :min="1" :max="5000" label=""></el-input-number>
              </el-form-item>

            </el-col>
          </el-row>
          <el-form-item label="标签">
            <el-checkbox-group v-model="dialogForm.tags">
              <el-checkbox label="集体供暖" name="tags"></el-checkbox>
              <el-checkbox label="独立阳台" name="tags"></el-checkbox>
              <el-checkbox label="光照充足" name="tags"></el-checkbox>
              <el-checkbox label="独立卫生间" name="tags"></el-checkbox>
              <el-checkbox label="空调" name="tags"></el-checkbox>
              <el-checkbox label="精装修" name="tags"></el-checkbox>
              <el-checkbox label="近地铁" name="tags"></el-checkbox>
              <el-checkbox label="随时看房" name="tags"></el-checkbox>
            </el-checkbox-group>
          </el-form-item>
          <el-form-item label="图片">
            <el-upload
              limit="2"
              class="upload-demo"
              ref="upload"
              action=""
              :on-change="handleChange"
              :on-remove="handleRemove"
              :file-list="dialogForm.imgUrl"
              list-type="picture-card"
              :auto-upload="false">
              <el-button slot="trigger" size="mini">选取图片</el-button>
              <div slot="tip" class="el-upload__tip">只能上传jpg/png文件，最多上传两张</div>
            </el-upload>
          </el-form-item>
          <div style="display: flex;justify-content: center">
            <el-button type="primary" size="small" @click="dialogAdd(dialogIndex,'form')">{{dialogForm.address === ''?'保存':'修改'}}</el-button>
            <el-button  size="small" @click="dialogVisible = false">取消</el-button>
          </div>
