</template>

<script>
  import { regionData} from 'element-china-area-data'
  export default {
    data(){
      return{
        loading:false,
        fileList: [],
        form:{
          chinaArea: [],
          createdTime:[],
        },
        tableData: [
          // {
          //   id:1,
          //   chinaArea:['110000','110100','110101'],
          //   address:'地址',
          //   bedRoom:1,
          //   orientation:'朝东',
          //   createdTime:'2018-06-26 21:47:37',
          //   editTime:'',
          //   height:4,
          //   maxHeight:10,
          //   area:10,
          //   price:1000,
          //   lease:'整租',
          //   tags:['集体供暖','独立阳台'],
          //   img:[
          //     {
          //       name:'1.png',
          //       url:'data:image/png;base64,',
          //       uid:1554863860402,
          //     },
          //   ],
          //   status:true,
          // }
        ],
        tablePageData:[],
        currentPage: 1,
        total:0,
        dialogVisible:false,
        dialogIndex:-1,//-1:新增，>-1:修改
        dialogForm:{
          id:'',
          chinaArea:[],
          address:'',
          bedRoom:'',
          orientation:'',
          createdTime:'',
          editTime:'',
          height:'',
          maxHeight:'',
          area:'',
          price:'',
          lease:'',
          tags:[],
          imgUrl:[],
          status:false,
        },
        dialogFormArea :[],
      }
    },
    methods:{
      clearFormCreatedTime(){
        let _self = this;
        if( _self.form.createdTime == null){
          _self.form.createdTime = []
        }
        _self.getTablePageData('click');
      },
      handleRemove(file, fileList) {
        let _self = this;
        for(let i in _self.dialogForm.imgUrl){
          if(_self.dialogForm.imgUrl[i].uid == file.uid){
            _self.dialogForm.imgUrl.splice(i,1)
          }
        }
      },
      handleChange(file) {
        let _self = this;
        let reader = new FileReader()
        reader.onload = () => {
          let _base64 = reader.result;
          _self.dialogForm.imgUrl.push({
            name:file.name,
            uid:file.uid,
            url:_base64
          })
        }
        reader.readAsDataURL(file.raw);
      },
      dialogClose(){
        let _self = this;
        _self.dialogForm = {
          id:'',
          chinaArea:[],
          address:'',
          bedRoom:'',
          orientation:'',
          createdTime:'',
          editTime:'',
          height:'',
          maxHeight:'',
          area:'',
          price:'',
          lease:'',
          tags:[],
          imgUrl:[],
          status:false,
        },
        _self.dialogIndex = -1;
      },
      dialogOpen(index, row) {
        this.$refs['form'].resetFields()
        let _self = this;
        let data = row;
        console.log(row);
        localStorage.setItem('row',JSON.stringify(data));
        _self.dialogForm = row?JSON.parse(localStorage.getItem('row')):_self.dialogForm;
        _self.dialogIndex = row?index:-1;
        _self.dialogVisible = true;
      },
      dialogAdd(index,formName){
        let _self = this;
        this.$refs[formName].validate((valid) => {
          if (valid) {
            _self.dialogForm.editTime = _self.getTime(new Date());
            console.log(_self.dialogForm.editTime);
            if(index == -1){//新增
              _self.dialogForm.id = _self.tableData.length>0?(parseInt(_self.tableData[_self.tableData.length-1].id)+1):1;
              _self.tableData.push(_self.dialogForm);
            }else{//修改
              for(let i in _self.tableData){
                if(_self.dialogForm.id == _self.tableData[i].id){
                  _self.tableData[i] = _self.dialogForm;
                }
              }
            };
            localStorage.setItem('tableData',JSON.stringify(_self.tableData));
            _self.getTablePageData();
            _self.dialogVisible = false;
          } else {
            console.log('error submit!!');
            return false;
          }
        });
      },
      handleDelete(index, row) {
        let _self = this;
        _self.$confirm('确定删除这条数据吗?', '确认', {
          confirmButtonText: '确定',
          cancelButtonText: '取消',
          type: 'warning'
        }).then(() => {
          for(let i in _self.tableData){
            if(row.id == _self.tableData[i].id){
              _self.tableData.splice(i,1);
            }
          }
          localStorage.setItem('tableData',JSON.stringify(_self.tableData));
          _self.getTablePageData();
        });
      },
      handleCurrentChange(val) {
        let _self = this;
        _self.currentPage = val;
        _self.getTablePageData();
      },
      getTime (date) {
        var y = date.getFullYear();
        var m = date.getMonth() + 1;
        m = m < 10 ? ('0' + m) : m;
        var d = date.getDate();
        d = d < 10 ? ('0' + d) : d;
        var h = date.getHours();
        h=h < 10 ? ('0' + h) : h;
        var minute = date.getMinutes();
        minute = minute < 10 ? ('0' + minute) : minute;
        var second=date.getSeconds();
        second=second < 10 ? ('0' + second) : second;
        return y + '-' + m + '-' + d+' '+h+':'+minute+':'+second;
      },
      getTablePageData(action){
        let _self = this;
        _self.loading = true;
        _self.tableData = localStorage.getItem('tableData')?JSON.parse(localStorage.getItem('tableData')):[];
        let arr = [];
        for(let i in _self.tableData){
          let isPush = true;
          if(_self.form.chinaArea.length > 0){
            // console.log(_self.form.chinaArea);
            // console.log(_self.tableData[i].chinaArea);
            // console.log(!_self.equar(_self.form.chinaArea, _self.tableData[i].chinaArea));
            if(!_self.equar(_self.form.chinaArea,_self.tableData[i].chinaArea)){
              isPush = false;
            }
          }
          if(_self.form.createdTime.length > 0&&_self.form.createdTime !=null){
            if(!(_self.getTimeStamp(_self.form.createdTime[0])< _self.getTimeStamp(_self.tableData[i].editTime) && _self.getTimeStamp(_self.form.createdTime[1])> _self.getTimeStamp(_self.tableData[i].editTime))){
              isPush = false;
            }
          }
          if(isPush){
            arr.push(_self.tableData[i]);
          }
        }

        // if(_self.form.chinaArea.length > 0 &&_self.form.createdTime.length == 0){
        //   for(let i in _self.tableData){
        //     if(_self.equar(_self.form.chinaArea,_self.tableData[i].chinaArea)){
        //       arr.push(_self.tableData[i]);
        //     }
        //   }
        // }
        // else if(_self.form.chinaArea.length == 0 &&_self.form.createdTime.length > 0){
        //   for(let i in _self.tableData){
        //     if(_self.getTimeStamp(_self.form.createdTime[0])< _self.getTimeStamp(_self.tableData[i].editTime) && _self.getTimeStamp(_self.form.createdTime[1])> _self.getTimeStamp(_self.tableData[i].editTime)){
        //       arr.push(_self.tableData[i]);
        //     }
        //   }
        // }
        // else if(_self.form.chinaArea.length > 0 &&_self.form.createdTime.length > 0){
        //   for(let i in _self.tableData){
        //     if(_self.equar(_self.form.chinaArea,_self.tableData[i].chinaArea) && _self.getTimeStamp(_self.form.createdTime[0])< _self.getTimeStamp(_self.tableData[i].editTime) && _self.getTimeStamp(_self.form.createdTime[1])> _self.getTimeStamp(_self.tableData[i].editTime)){
        //       arr.push(_self.tableData[i]);
        //     }
        //   }
        // }
        // else if(_self.form.chinaArea.length == 0 &&_self.form.createdTime.length == 0){
        //   for(let i in _self.tableData){
        //     arr.push(_self.tableData[i]);
        //   }
        // }
        setTimeout(function () {
          _self.loading = false;
          _self.total = arr.length;
          _self.currentPage = action?1:_self.currentPage;
          _self.tablePageData = arr.splice((_self.currentPage-1)*5,5);
        },500)
      },
      equar(a, b) {
        if (a.length !== b.length) {
          return false
        } else {
          for (let i = 0; i < a.length; i++) {
            if (a[i] !== b[i]) {
              return false
            }
          }
          return true;
        }
      },
      getTimeStamp(time){
        let T = new Date(time);
        return T.getTime();
      }
    },
    created(){
      let _self = this;
      _self.dialogFormArea = regionData
      _self.getTablePageData();
    },
    mounted(){
     }
  }
</script>

